      out.write("    function getDateFormat(date) {\r\n");
      out.write("        let month = date.getMonth() + 1;\r\n");
      out.write("        let day = date.getDate();\r\n");
      out.write("        let hour = date.getHours();\r\n");
      out.write("        let minute = date.getMinutes();\r\n");
      out.write("        let second = date.getSeconds();\r\n");
      out.write("\r\n");
      out.write("        month = month >= 10 ? month : '0' + month;\r\n");
      out.write("        day = day >= 10 ? day : '0' + day;\r\n");
      out.write("        hour = hour >= 10 ? hour : '0' + hour;\r\n");
      out.write("        minute = minute >= 10 ? minute : '0' + minute;\r\n");
      out.write("        second = second >= 10 ? second : '0' + second;\r\n");
      out.write("\r\n");
      out.write("        return date.getFullYear() + '-' + month + '-' + day + ' ' + hour + ':' + minute + ':' + second;\r\n");
