      out.write("				// Review DB 가져온 뒤 Carousel 연결 함수\r\n");
      out.write("				function getReviewData() {\r\n");
      out.write("					$.getJSON(\"/review.index\", res => {\r\n");
      out.write("						let item_list = document.querySelectorAll(\".item\");\r\n");
      out.write("						for (i = 0; i < item_list.length / 2; i++) {\r\n");
      out.write("							let review = reviewBuilder(res.reviewList[i]);\r\n");
      out.write("							item_list[i].innerHTML = review;\r\n");
      out.write("							item_list[i + 10].innerHTML = review;\r\n");
      out.write("							$(item_list[i]).find(\".item_title>a\")[0].innerText = res.reviewList[i].gym.gym_name;\r\n");
      out.write("							$(item_list[i+ 10]).find(\".item_title>a\")[0].innerText = res.reviewList[i].gym.gym_name;\r\n");
      out.write("							$(item_list[i]).find(\".item_contents\")[0].innerText = res.reviewList[i].review.review_contents;\r\n");
      out.write("							$(item_list[i+ 10]).find(\".item_contents\")[0].innerText = res.reviewList[i].review.review_contents;\r\n");
      out.write("						}\r\n");
      out.write("					});\r\n");
      out.write("				}\r\n");
      out.write("\r\n");
      out.write("				// Review 폼 구성 함수\r\n");
      out.write("				function reviewBuilder(data) {\r\n");
      out.write("					let gymName = \"<div class='col-12 text_title_600 text-truncate item_title'><a href='/detail.gym?gym_seq=\" + data.gym.gym_seq + \"'></a></div>\";\r\n");
      out.write("					let star = \"\";\r\n");
      out.write("					for (j = 1; j < 6; j++) {star += j <= data.review.review_star ? \"<label class='item_filledStar'>★</label>\" : \"<label class='item_emptyStar'>★</label>\";}\r\n");
      out.write("					let score = \"<div class='col-12 gy-2' align=center>\" + star + \"</div>\";\r\n");
      out.write("					let space = \"<div class='col-1 gy-3'></div><hr class='col-10 gy-3'><div class='col-1 gy-3'></div>\";\r\n");
      out.write("					let certified = data.review.review_photo == \"인증완료\" ? \"<img src='/resource/fitneeds.ico' style='display:inline-block; width:20px'> \" : \" \"\r\n");
      out.write("					let writer = \"<div class='col-6 text-start text-truncate item_writer' style='padding-left:15px'>\" + certified + data.review.review_writer + \"</div>\";\r\n");
      out.write("					let writeDate = \"<div class='col-6 text_mini text-end text item_date' style='color:#808080; padding-right:15px'>\" + getDateFormat(new Date(data.review.review_writer_date)).slice(0, -3) + \"</div>\";\r\n");
      out.write("					let likes = \"<div class='col-6'></div><div class='col-6 text_mini text-end item_likes' style='color:#808080; padding-right:15px'>추천수 : \" + data.review.review_like + \"</div>\";\r\n");
      out.write("					let contents = \"<div class='col-12 gy-3 item_contents'></div>\";\r\n");
      out.write("					let medal = \"<img src='resource/img/medal.png' class='item_medal'>\"\r\n");
      out.write("					let result = \"<div class='row'>\" + gymName + score + space + writer + writeDate + likes + contents + \"</div>\" + medal;\r\n");
      out.write("					return result;\r\n");
      out.write("					// 오리 아이콘 <img src='/resource/duck.ico' style='display:inline-block; width:20px'>&nbsp\r\n");
      out.write("				}\r\n");
      out.write("\r\n");
