      out.write("							$(item).find(\".imgFilter>p\").html(data.gym.gym_name + \"<br>💕&nbsp\" + data.favorites.count).attr(\"seq\", data.gym.gym_seq);\r\n");
      out.write("							$(item).find(\".imgFilter\").attr(\"seq\", data.gym.gym_seq);\r\n");
